//根据城市名称判断是否支持公交
function isCityHaveBusInfo(strCityName)
{
	if( typeof strCityName == "undefined" || strCityName == null || strCityName.length < 1 ) return false;
	var i = 0;
	for( i = 0 ; i < arBusCity.length ; i ++)
	{
		if( trim(strCityName) == arBusCity[i] ) return true;
	}
	return false;
}
//自动匹配  "市"
function isCityHaveBusInfoShi(strCityName)
{
	if( typeof strCityName == "undefined" || strCityName == null || strCityName.length < 1 ) return false;
	var i = 0;
	for( i = 0 ; i < arBusCity.length ; i ++)
	{   
	  if(arBusCity[i].substring(arBusCity[i].length-1,arBusCity[i].length)=="市")	{
		if(trim(strCityName) == arBusCity[i]|| trim(strCityName)==arBusCity[i].substring(0,arBusCity[i].length-1) ) return true;
	  }
	  if(arBusCity[i].substring(arBusCity[i].length-3,arBusCity[i].length)=="自治州"){
		  if(trim(strCityName) == arBusCity[i]|| trim(strCityName)==arBusCity[i].substring(0,2) ) return true;
	  }
	   if(arBusCity[i].substring(arBusCity[i].length-3,arBusCity[i].length)=="行政区"){
		  if(trim(strCityName) == arBusCity[i]|| trim(strCityName)==arBusCity[i].substring(0,2) ) return true;
	  }
	}
	return false;
}
