//根据城市名取ccid
function getCCIDByCity(strCity){
	if( typeof strCity == "undefined" || strCity == null || strCity == "" ) return "";
	for( var i = 0 ; i < arShengCity.length ; i ++){
		var cityList = arShengCity[i];
		for(var j=1;j<cityList.length;j++){
			if(strCity == cityList[j]){
				return cityList[0];
				break;
			}
		}
	}
	return "";
}


//根据CCID得城市名称
function getCityNameByCCID(strCCID)
{
	if( typeof strCCID == "undefined" || strCCID == null || strCCID.length < 1 ) return null;
	
	for( var i = 0 ; i < arPyIndex.length ; i ++)
	{
		for(var j=0;j<arPyIndex[i].length;j++){
			if( trim(strCCID) == arPyIndex[i][j][3] ) 
			{
				return arPyIndex[i][j][2];
			}
		}
	}
	return null;
}

