//去掉首尾空格
function   trimstr(s)   {   
      var   i;   
      for   (i   =   0;   i   <   s.length   &&   s.charCodeAt(i)   ==   32;   i   ++);   
      s   =   s.substring(i,   s.length);   
      for   (i   =   s.length   -   1;   i   >=   0   &&   s.charCodeAt(i)   ==   32;   i--);   
      s   =   s.substring(0,   i   +   1);   
      return   s;   
 } 
if(typeof trim == "undefined") trim = trimstr;

//搜索城市，在这个函数中判断输入的是拼音还是汉字
function searchCity(strKey)
{
	if( typeof strKey == "undefined" || strKey == null || strKey.length < 1 ) return null;
	
	var a = trim(strKey).charCodeAt(0);
	if(a > 127 || a < 0 )
		return searchByHZ(strKey);
	else
		return sarchByPY(strKey);
	
}

//按照拼音，或者拼音首字母搜索
function sarchByPY(strPY)
{
	//alert(strPY);
	var arRs = null;
	if( typeof strPY == "undefined" || strPY == null || strPY.length < 1 ) return null;
	var strPYLC = trim(strPY).toLowerCase();
	
	if(isNaN(strPY)) 
	{ 
		var i = 0,nPos = 0,nLen = 0;
		nPos = strPYLC.charCodeAt(0)-97;
		//alert(nPos);
		if(nPos<0 || nPos>25) return null;
		nLen = trim(strPY).length;
		//alert(nLen);
		arRs = new Array();
		for( i = 0 ; i < arPyIndex[nPos].length ; i ++)
		{
			if( strPYLC == arPyIndex[nPos][i][0].substring(0,nLen) || strPYLC == arPyIndex[nPos][i][1].substring(0,nLen) ) 
			{
				arRs.push(arPyIndex[nPos][i]);
				//alert(arPyIndex[nPos][i]);
			}
		}
	}else{
		var i = 0,j=0,nPos = 0,nLen = 0;
		nLen = trim(strPY).length;
		arRs = new Array();
		for( i = 0 ; i < arPyIndex.length ; i ++)
		{
			for(j=0;j<arPyIndex[i].length; j ++){
				if( strPYLC == arPyIndex[i][j][3].substring(0,nLen)) 
					arRs.push(arPyIndex[i][j]);
			}
		}
	}

	if(arRs.length < 1 ) arRs = null;
	return arRs;
}



//按照汉字，
function searchByHZ(strHZ)
{
	var arRs = null;
	if( typeof strHZ == "undefined" || strHZ == null || strHZ.length < 1 ) return null;//汉字最少两个字节

	var strPYLC = trim(strHZ).substring(0,1);
	var i = 0,nPos = -1,nLen = 0;
	
	for( i = 0 ; i < arHZIndex1.length ; i ++)
	{
		if(arHZIndex1[i] == strPYLC)
		{
			nPos = i;
			break;
		}
	}
	if( nPos < 0 ) return null;//没有匹配上第一个汉字就直接返回
	//arHZIndex
	nLen = trim(strHZ).length;
	arRs = new Array();
	//alert(nLen);
	for( i = 0 ; i < arHZIndex[nPos].length ; i ++)
	{//alert(arHZIndex[nPos][i][2].substring(0,nLen));
		if( trim(strHZ) == arHZIndex[nPos][i][2].substring(0,nLen) ) 
		{
			arRs.push(arHZIndex[nPos][i]);
		}
	}
	if(arRs.length < 1 ) arRs = null;
	return arRs;
}




